import React from 'react';

import Section2 from './Section2'

const ListsVideo = props => {

      return (
        <section>
        <h4>NEXT VIDEO</h4>
        <div id="sidevideo">{
            this.state.stateArray.map((sideArray, index) =>
                <Section2 
                    key={index}
                    title={sideArray.title}
                    channel={sideArray.channel}
                    image={sideArray.image}
                />
            )
        }
        </div>
        </section>
          )
    };  



export default ListsVideo;
